import classes from './TopToolBox.module.css';


const TopToolBox =(props) =>{



return (

     <div className={classes.tool} style={{backgroundColor:props.toolBoxStyle.boxBkgColor}}>

      <div className={classes.upperHalf}>
         <button className={classes.actionButton} style={{backgroundColor:props.toolBoxStyle.buttonBkgColor}}> Create a course </button>
         <div className={classes.numOngoing} style={{borderColor:props.toolBoxStyle.boxBkgColor}}>
              <div className={classes.numOngoing_text} style={{color:props.toolBoxStyle.rightTopBoxColor}}>Ongoing</div>
              <div className={classes.numOngoing_number}>3</div>
         </div>
      </div>

      <div className={classes.lowerHalf} >                                              
        <i style={{color: props.toolBoxStyle.buttonBkgColor}}><span>TOTAL COURSES :</span> <span className={classes.numCourses}> 5 </span></i>
      </div>
    </div>










  );





}


export default TopToolBox;
